def plot_data(plans, bright_plans, filename):
	plans_succeded = [x for x in plans if x != None]
	bright_plans_succeded = [x for x in bright_plans if x != None]
	P.figure()
	P.title(filename)
	P.subplot(2,2,1)

	# Now plot bar chart compariong how many actually succeded
	n, bins, patches = P.hist( [plans_succeded,bright_plans_succeded], 10, histtype='bar',
							 label=['naive-sampler', 'construct sampler'])

	P.legend()

	P.subplot(2,2,2)
	fract_complete = float(len(plans_succeded)) / len(plans)
	fract_bright_complete = float(len(bright_plans_succeded)) / len(bright_plans)
	samplers = ('Naive', 'Construct')
	y_pos = np.arange(len(samplers))
	P.barh(y_pos, [fract_complete, fract_bright_complete], align='center', alpha=0.4)
	P.yticks(y_pos, samplers)
	P.xlabel('Fraction of successful iterations')

	P.subplot(2,2,3)
	mean_its = float(sum(plans_succeded))/len(plans_succeded)
	mean_bright_its = float(sum(bright_plans_succeded))/len(bright_plans_succeded)
	P.barh(y_pos, [mean_its, mean_bright_its], align='center', alpha=0.4)
	P.yticks(y_pos, samplers)
	P.xlabel('Mean number of iterations')

plot_data(plans, bright_plans, "plan-star3")
